KISSY.add("apiapp/mviews/partials/index",function(a,b,c,d,e){return b.extend({tmpl:'<div class="clearfix dir">\r\n    {{if data.extList&&data.extList.length}}<div class="menu-t">\u6838\u5fc3\u6a21\u5757</div>{{/if}}\r\n    <ul class="menu">\r\n        {{infos=data.infos}}\r\n        {{each data.coreList as one}}\r\n        <li class="menu-list">\r\n            <a href="#!/{{infos.loader}}/{{infos.ver}}/{{one.name}}">{{one.dName}}</a>\r\n            <span class="desc">({{data.extInfo(one.name)}})</span>\r\n        </li>\r\n        {{/each}}\r\n    </ul>\r\n    {{if data.extList&&data.extList.length}}\r\n    <div class="menu-t">\u6269\u5c55\u6a21\u5757</div>\r\n    <ul class="menu">\r\n        {{each data.extList as one}}\r\n        <li class="menu-list">\r\n            <a href="#!/{{infos.loader}}/{{infos.ver}}/{{one.name}}">{{one.dName}}</a>\r\n            <span>({{data.extInfo(one.name)}})</span>\r\n        </li>\r\n        {{/each}}\r\n    </ul>\r\n    {{/if}}\r\n</div>',render:function(){var a=this,b=c.fetchClassInfos(a);b.next(function(c,f){c?a.setViewHTML(a.id,c.msg):b.fetchAll({name:"Class_List"},function(b,c){if(b)a.setViewHTML(a.id,b.msg);else{var g=d.render(a.tmpl,{coreList:c.get("coreList"),extList:c.get("extList"),infos:e.local("APIPathInfo"),extInfo:function(a){var b=f.map[a];return b?b.get("desc")||a:"unfound"}});a.setViewHTML(a.id,g)}})})}})},{requires:["magix/view","apiapp/models/manager","apiapp/helpers/crox","magix/magix"]});